        setRepositories(repositoriesName);
        //localStorage.clear();
        //console.log(repositoriesName);

    }, []);

    return (
        <div>
            <h1>Repositórios</h1>
            <ul>
                { repositories.map(repository => {
                    return (
                        <li>Repositório: { repository }</li>
                    )
                }) }  
            </ul>
        </div>
     
    )
}
